import React, { useState, useEffect, useRef } from "react";

export default function ReactHookDemo() {
  const styles = {
    container: {
      fontFamily: "Arial, sans-serif",
      padding: "20px",
      maxWidth: "900px",
      margin: "0 auto",
      lineHeight: "1.6",
    },
    heading: {
      fontSize: "32px",
      fontWeight: "bold",
      marginBottom: "20px",
      color: "#2d2d2d",
    },
    section: {
      marginBottom: "25px",
      padding: "15px",
      borderRadius: "12px",
      background: "#f5f5f5",
      boxShadow: "0 2px 5px rgba(0,0,0,0.1)",
    },
    codeBox: {
      background: "#1e1e1e",
      color: "#dcdcdc",
      padding: "15px",
      borderRadius: "8px",
      marginTop: "10px",
      whiteSpace: "pre-wrap",
      fontSize: "14px",
    },
  };

  // useState example
  const [count, setCount] = useState(0);

  // useEffect example
  useEffect(() => {
    console.log("Count updated:", count);
  }, [count]);

  // useRef example
  const inputRef = useRef(null);

  const focusInput = () => {
    inputRef.current.focus();
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>React Hooks Complete Overview</h1>

      <div style={styles.section}>
        <h2>What are React Hooks?</h2>
        <p>
          React Hooks are functions that allow you to use React features like
          state, lifecycle methods, and refs inside functional components.
          Hooks remove the need for class components and make code cleaner and
          easier to understand.
        </p>
      </div>

      <div style={styles.section}>
        <h2>useState Hook</h2>
        <p>
          <b>useState</b> allows you to create and manage component state.
        </p>
        <button onClick={() => setCount(count + 1)}>
          Increase Count ({count})
        </button>
        <div style={styles.codeBox}>{`
const [count, setCount] = useState(0);

<button onClick={() => setCount(count + 1)}>Increase</button>
        `}</div>
      </div>

      <div style={styles.section}>
        <h2>useEffect Hook</h2>
        <p>
          <b>useEffect</b> is used to run side effects like API calls, event
          listeners, or updating the document title.
        </p>
        <div style={styles.codeBox}>{`
useEffect(() => {
  console.log("Count updated", count);
}, [count]);
        `}</div>
      </div>

      <div style={styles.section}>
        <h2>useRef Hook</h2>
        <p>
          <b>useRef</b> stores a mutable value that does not re-render the
          component. Commonly used to access DOM elements.
        </p>
        <input ref={inputRef} placeholder="Click button to focus" />
        <button onClick={focusInput}>Focus Input</button>
        <div style={styles.codeBox}>{`
const inputRef = useRef(null);

<input ref={inputRef} />
<button onClick={() => inputRef.current.focus()}>Focus</button>
        `}</div>
      </div>

      <div style={styles.section}>
        <h2>Why Hooks?</h2>
        <ul>
          <li>No more class components</li>
          <li>Cleaner and shorter code</li>
          <li>Reusability through custom hooks</li>
          <li>Better separation of logic</li>
        </ul>
      </div>

      <div style={styles.section}>
        <h2>Summary of Major Hooks</h2>
        <ul>
          <li><b>useState</b> – State management</li>
          <li><b>useEffect</b> – Side effects</li>
          <li><b>useRef</b> – DOM access / store values</li>
          <li><b>useContext</b> – Global state</li>
          <li><b>useReducer</b> – Advanced state logic</li>
          <li><b>useMemo</b> – Memoized values</li>
          <li><b>useCallback</b> – Memoized functions</li>
        </ul>
      </div>
    </div>
  );
}
